description:
Power Games is about the making of Modern Australia through the eyes of competing media moguls.

In the early 1960, boy publisher Rupert Murdoch receives an invitation from Australias most prominent media family, the Packers, for tennis and cocktails. By the end of the day, Sir Frank Packer, joined by sons Kerry and Clyde, make sport of Murdoch and attempt to run the boy publisher out of town. Little does anyone know the young man will one day be the most powerful media player in the world and hes not about to go home....
